INSERT INTO `Movie` (`movie_id`, `movie_title`, `movie_release`, `movie_overview`, `movie_img_url`, `movie_rating`, `movie_popular`, `director_id`) VALUES
(129, 'Spirited Away', '2001-07-20', 'A young girl, Chihiro, becomes trapped in a strange new world of spirits. When her parents undergo a mysterious transformation, she must call upon the courage she never knew she had to free her family.', 'https://image.tmdb.org/t/p/original/39wmItIWsg5sZMyRUHLkWBcuVCM.jpg', 8.541, 112.06, 608),
(155, 'The Dark Knight', '2008-07-16', 'Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.', 'https://image.tmdb.org/t/p/original/qJ2tW6WMUDux911r6m7haRef0WH.jpg', 8.515, 100.611, 525),
(429, 'The Good, the Bad and the Ugly', '1966-12-22', 'While the Civil War rages on between the Union and the Confederacy, three men – a quiet loner, a ruthless hitman, and a Mexican bandit – comb the American Southwest in search of a strongbox containing $200,000 in stolen gold.', 'https://image.tmdb.org/t/p/original/bX2xnavhMYjWDoZp1VM6VnU1xwe.jpg', 8.468, 98.7, 4385),
(557, 'Spider-Man', '2002-05-01', 'After being bitten by a genetically altered spider at Oscorp, nerdy but endearing high school student Peter Parker is endowed with amazing powers to become the superhero known as Spider-Man.', 'https://image.tmdb.org/t/p/original/gh4cZbhZxyTbgxQPxD0dOudNPTn.jpg', 7.293, 97.627, 7623),
(597, 'Titanic', '1997-11-18', '101-year-old Rose DeWitt Bukater tells the story of her life aboard the Titanic, 84 years later. A young Rose boards the ship with her mother and fiancé. Meanwhile, Jack Dawson and Fabrizio De Rossi win third-class tickets aboard the ship. Rose tells the whole story from Titanic\'s departure through to its death—on its first and last voyage—on April 15, 1912.', 'https://image.tmdb.org/t/p/original/9xjZS2rlVxm8SFx8kPC3aIGCOYQ.jpg', 7.904, 114.172, 2710),
(671, 'Harry Potter and the Philosopher\'s Stone', '2001-11-16', 'Harry Potter has lived under the stairs at his aunt and uncle\'s house his whole life. But on his 11th birthday, he learns he\'s a powerful wizard—with a place waiting for him at the Hogwarts School of Witchcraft and Wizardry. As he learns to harness his newfound powers with the help of the school\'s kindly headmaster, Harry uncovers the truth about his parents\' deaths—and about the villain who\'s to blame.', 'https://image.tmdb.org/t/p/original/wuMc08IPKEatf9rnMNXvIDxqP4W.jpg', 7.914, 178.068, 10965),
(672, 'Harry Potter and the Chamber of Secrets', '2002-11-13', 'Cars fly, trees fight back, and a mysterious house-elf comes to warn Harry Potter at the start of his second year at Hogwarts. Adventure and danger await when bloody writing on a wall announces: The Chamber Of Secrets Has Been Opened. To save Hogwarts will require all of Harry, Ron and Hermione’s magical abilities and courage.', 'https://image.tmdb.org/t/p/original/sdEOH0992YZ0QSxgXNIGLq1ToUi.jpg', 7.72, 143.939, 10965),
(673, 'Harry Potter and the Prisoner of Azkaban', '2004-05-31', 'Year three at Hogwarts means new fun and challenges as Harry learns the delicate art of approaching a Hippogriff, transforming shape-shifting Boggarts into hilarity and even turning back time. But the term also brings danger: soul-sucking Dementors hover over the school, an ally of the accursed He-Who-Cannot-Be-Named lurks within the castle walls, and fearsome wizard Sirius Black escapes Azkaban. And Harry will confront them all.', 'https://image.tmdb.org/t/p/original/aWxwnYoe8p2d2fcxOqtvAtJ72Rw.jpg', 8.016, 147.004, 11218),
(674, 'Harry Potter and the Goblet of Fire', '2005-11-16', 'When Harry Potter\'s name emerges from the Goblet of Fire, he becomes a competitor in a grueling battle for glory among three wizarding schools—the Triwizard Tournament. But since Harry never submitted his name for the Tournament, who did? Now Harry must confront a deadly dragon, fierce water demons and an enchanted maze only to find himself in the cruel grasp of He Who Must Not Be Named.', 'https://image.tmdb.org/t/p/original/fECBtHlr0RB3foNHDiCBXeg9Bv9.jpg', 7.813, 143.401, 10723),
(2062, 'Ratatouille', '2007-06-28', 'Remy, a resident of Paris, appreciates good food and has quite a sophisticated palate. He would love to become a chef so he can create and enjoy culinary masterpieces to his heart\'s delight. The only problem is, Remy is a rat. When he winds up in the sewer beneath one of Paris\' finest restaurants, the rodent gourmet finds himself ideally placed to realize his dream.', 'https://image.tmdb.org/t/p/original/t3vaWRPSf6WjDSamIkKDs1iQWna.jpg', 7.818, 114.811, 7087),
(4935, 'Howl\'s Moving Castle', '2004-09-09', 'Sophie, a young milliner, is turned into an elderly woman by a witch who enters her shop and curses her. She encounters a wizard named Howl and gets caught up in his resistance to fighting for the king.', 'https://image.tmdb.org/t/p/original/6pZgH10jhpToPcf0uvyTCPFhWpI.jpg', 8.41, 116.981, 608),
(6844, 'The Ten Commandments', '1956-10-05', 'Escaping death, a Hebrew infant is raised in a royal household to become a prince. Upon discovery of his true heritage, Moses embarks on a personal quest to reclaim his destiny as the leader and liberator of the Hebrew people.', 'https://image.tmdb.org/t/p/original/2rBUaC6ngeFmYXjL4KA3eLjt5wA.jpg', 7.755, 188.971, 8636),
(9339, 'Click', '2006-06-23', 'A married workaholic, Michael Newman doesn\'t have time for his wife and children, not if he\'s to impress his ungrateful boss and earn a well-deserved promotion. So when he meets Morty, a loopy sales clerk, he gets the answer to his prayers: a magical remote that allows him to bypass life\'s little distractions with increasingly hysterical results.', 'https://image.tmdb.org/t/p/original/oL0k5JA53PyoHSZqKb3cNkhwBCE.jpg', 6.3, 84.702, 57370),
(9381, 'Babylon A.D.', '2008-08-20', 'A veteran-turned-mercenary is hired to take a young woman with a secret from post-apocalyptic Eastern Europe to New York City.', 'https://image.tmdb.org/t/p/original/kt9nqD0uOar8IVE9191HXhWOXKI.jpg', 5.648, 94.364, 2406),
(9473, 'South Park: Bigger, Longer & Uncut', '1999-06-30', 'When the four boys see an R-rated movie featuring Canadians Terrance and Philip, they are pronounced \"corrupted\", and their parents pressure the United States to wage war against Canada.', 'https://image.tmdb.org/t/p/original/tS0PedvA2mFO9VCHYwQpaU1K36U.jpg', 7.264, 100.645, 34517),
(9732, 'The Lion King II: Simba\'s Pride', '1998-10-24', 'The circle of life continues for Simba, now fully grown and in his rightful place as the king of Pride Rock. Simba and Nala have given birth to a daughter, Kiara who\'s as rebellious as her father was. But Kiara drives her parents to distraction when she catches the eye of Kovu, the son of the evil lioness, Zira. Will Kovu steal Kiara\'s heart?', 'https://image.tmdb.org/t/p/original/sWR1x6UCMCGN9xEf8RGhPS934X0.jpg', 6.943, 75.587, 58829),
(10135, 'Road House', '1989-05-19', 'The Double Deuce is the meanest, loudest and rowdiest bar south of the Mason-Dixon Line, and Dalton has been hired to clean it up. He might not look like much, but the Ph.D.-educated bouncer proves he\'s more than capable – busting the heads of troublemakers and turning the roadhouse into a jumping hot spot. But Dalton\'s romance with the gorgeous Dr. Clay puts him on the bad side of cutthroat local big shot Brad Wesley.', 'https://image.tmdb.org/t/p/original/r2hGyhvNneAifk7UpwAYxrkeFO4.jpg', 6.686, 89.519, 63943),
(10192, 'Shrek Forever After', '2010-05-16', 'A bored and domesticated Shrek pacts with deal-maker Rumpelstiltskin to get back to feeling like a real ogre again, but when he\'s duped and sent to a twisted version of Far Far Away—where Rumpelstiltskin is king, ogres are hunted, and he and Fiona have never met—he sets out to restore his world and reclaim his true love.', 'https://image.tmdb.org/t/p/original/6HrfPZtKcGmX2tUWW3cnciZTaSD.jpg', 6.364, 110.676, 64151),
(10625, 'Mean Girls', '2004-04-30', 'Cady Heron is a hit with The Plastics, the A-list girl clique at her new school, until she makes the mistake of falling for Aaron Samuels, the ex-boyfriend of alpha Plastic Regina George.', 'https://image.tmdb.org/t/p/original/alKvY5LuVcXraRBfi5UtVV8Ii6Y.jpg', 7.209, 96.055, 54050),
(10674, 'Mulan', '1998-06-18', 'To save her father from certain death in the army, a young woman secretly enlists in his place and becomes one of China\'s greatest heroines in the process.', 'https://image.tmdb.org/t/p/original/5TYgKxYhnhRNNwqnRAKHkgfqi2G.jpg', 7.9, 99.498, 66191),
(11688, 'The Emperor\'s New Groove', '2000-12-15', 'Kuzco is a self-centered emperor who summons Pacha from a village and to tell him that his home will be destroyed to make room for Kuzco\'s new summer home. Kuzco\'s advisor, Yzma, tries to poison Kuzco and accidentally turns him into a llama, who accidentally ends up in Pacha\'s village. Pacha offers to help Kuzco if he doesn\'t destroy his house, and so they form an unlikely partnership.', 'https://image.tmdb.org/t/p/original/wwbgkXQBEKtnyIJapk6gUgWkVw8.jpg', 7.558, 113.352, 61411),
(19995, 'Avatar', '2009-12-15', 'In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien civilization.', 'https://image.tmdb.org/t/p/original/kyeqWdyUXW608qlYkRqosgbbJyK.jpg', 7.58, 142.889, 2710),
(24238, 'Mary and Max', '2009-02-09', 'A tale of friendship between two unlikely pen pals: Mary, a lonely, eight-year-old girl living in the suburbs of Melbourne, and Max, a forty-four-year old, severely obese man living in New York.', 'https://image.tmdb.org/t/p/original/ebmsM382m9IClLUzKYY2U5biFwM.jpg', 7.848, 111.709, 92733),
(27205, 'Inception', '2010-07-15', 'Cobb, a skilled thief who commits corporate espionage by infiltrating the subconscious of his targets is offered a chance to regain his old life as payment for a task considered to be impossible: \"inception\", the implantation of another person\'s idea into a target\'s subconscious.', 'https://image.tmdb.org/t/p/original/edv5CZvWj09upOsy2Y6IwDhK8bt.jpg', 8.367, 149.015, 525),
(38700, 'Bad Boys for Life', '2020-01-15', 'Marcus and Mike are forced to confront new threats, career changes, and midlife crises as they join the newly created elite team AMMO of the Miami police department to take down the ruthless Armando Armas, the vicious leader of a Miami drug cartel.', 'https://image.tmdb.org/t/p/original/y95lQLnuNKdPAzw9F9Ab8kJ80c3.jpg', 7.13, 112.63, 1399842),
(39254, 'Real Steel', '2011-09-28', 'Charlie Kenton is a washed-up fighter who retired from the ring when robots took over the sport. After his robot is trashed, he reluctantly teams up with his estranged son to rebuild and train an unlikely contender.', 'https://image.tmdb.org/t/p/original/4GIeI5K5YdDUkR3mNQBoScpSFEf.jpg', 6.993, 118.107, 17825),
(39323, 'Dragon Ball Z: Bardock - The Father of Goku', '1990-10-17', 'Bardock, Son Goku\'s father, is a low-ranking Saiyan soldier who was given the power to see into the future by the last remaining alien on a planet he just destroyed. He witnesses the destruction of his race and must now do his best to stop Frieza\'s impending massacre.', 'https://image.tmdb.org/t/p/original/docwOsWZuwJKQdwcYJtQPBcg6bm.jpg', 7.5, 90.105, 1060540),
(40132, 'Emanuelle and the White Slave Trade', '1978-04-20', 'Emanuelle returns to Kenya, trying to get an interview with a foreign gangster who\'s taken refuge in the African countryside while still operating an international criminal network.', 'https://image.tmdb.org/t/p/original/gDxsF7Mm32jLZqTT0o0rHXCQTjj.jpg', 4.8, 79.411, 31775),
(43074, 'Ghostbusters', '2016-07-14', 'Following a ghost invasion of Manhattan, paranormal enthusiasts Erin Gilbert and Abby Yates, nuclear engineer Jillian Holtzmann, and subway worker Patty Tolan band together to stop the otherworldly threat.', 'https://image.tmdb.org/t/p/original/wJmWliwXIgZOCCVOcGRBhce7xPS.jpg', 5.36, 145.844, 116805),
(45139, 'Jesus', '1979-10-19', 'Three and a half years of Jesus\' ministry, as told in the Gospel of Luke.', 'https://image.tmdb.org/t/p/original/lKveT74WCfqz8Bo56qFw8H6Dujz.jpg', 8.2, 119.724, 159232),
(46467, 'Zombie Women of Satan', '2009-08-31', 'When a group of nightclub performers – including Pervo the clown, Zeus, a flatulent dwarf, and Skye, a feisty rock chick – arrive on a remote farm for a cable TV interview, they soon discover the dark secret of the sinister family who live there – they have been kidnapping and torturing gorgeous young women as part of a perverted cult. However, the family’s experiments have now gone wrong, and the stocking-clad women have now become ravenous ZOMBIES! Now trapped, our ragtag group of visitors must unite in a desperate bid to stay alive… Sexy, gory and gut-munchingly hilarious – ZOMBIE WOMEN OF SATAN is THE most outrageous zombie comedy movie of the year!', 'https://image.tmdb.org/t/p/original/riuzfAbNBy1YT5V7SvKLJjoeFF1.jpg', 4, 72.649, 1837672),
(50619, 'The Twilight Saga: Breaking Dawn - Part 1', '2011-11-16', 'The new found married bliss of Bella Swan and vampire Edward Cullen is cut short when a series of betrayals and misfortunes threatens to destroy their world.', 'https://image.tmdb.org/t/p/original/qs8LsHKYlVRmJbFUiSUhhRAygwj.jpg', 6.199, 95.4, 15557),
(76600, 'Avatar: The Way of Water', '2022-12-14', 'Set more than a decade after the events of the first film, learn the story of the Sully family (Jake, Neytiri, and their kids), the trouble that follows them, the lengths they go to keep each other safe, the battles they fight to stay alive, and the tragedies they endure.', 'https://image.tmdb.org/t/p/original/t6HIqrRAclMCA60NsSmeqe9RmNV.jpg', 7.628, 263.597, 2710),
(101251, 'El Padrino II: Border Intrusion', '2008-01-01', '', 'https://image.tmdb.org/t/p/original/yHtPjWgO3wCnY21qKL3NjbBbthx.jpg', 6.2, 110.869, 58646),
(116236, 'Crazy Desire', '1962-03-15', 'A middle-aged businessman meets a band of rowdy youths and is smitten by one, named Francesca.', 'https://image.tmdb.org/t/p/original/6QAGmMS7bIjtpEfmZtZ5KVMRDvq.jpg', 6.6, 109.838, 31898),
(116776, 'Dragon Ball: Mystical Adventure', '1988-07-09', 'Master Roshi has succeeded at the one mission he valued most: to train Goku and Krillin to become ultimate fighters. So, he arranges for them to test their mettle at a competition hosted by Emperor Chiaotzu. Not everyone\'s playing by the rules, however, as a member of the ruler\'s household schemes to use the Dragonballs to extort money and power from the royal.', 'https://image.tmdb.org/t/p/original/4uPs9rjKkGWOmc5QO4VV08YdLpV.jpg', 6.8, 167.59, 67925),
(126963, 'Dragon Ball Z: Battle of Gods', '2013-03-30', 'The events of Battle of Gods take place some years after the battle with Majin Buu, which determined the fate of the entire universe. After awakening from a long slumber, Beerus, the God of Destruction is visited by Whis, his attendant and learns that the galactic overlord Frieza has been defeated by a Super Saiyan from the North Quadrant of the universe named Goku, who is also a former student of the North Kai. Ecstatic over the new challenge, Goku ignores King Kai\'s advice and battles Beerus, but he is easily overwhelmed and defeated. Beerus leaves, but his eerie remark of \"Is there nobody on Earth more worthy to destroy?\" lingers on. Now it is up to the heroes to stop the God of Destruction before all is lost.', 'https://image.tmdb.org/t/p/original/nxZEdYcHMuD8SSuwusDnK9CD2H1.jpg', 6.8, 101.972, 1083453),
(129213, 'Ghost Sweeper Mikami', '1994-12-04', 'Meet Mikami - the SEXY leader of one of Japan\'s most successful independent ghost-busting agencies. Together with her eclectic team of exorcists, she\'s prepared to do battle with any supernatural adversary - but only for the right price!  When an ancient spirit enlists her aid to deal with a re-incarnated foe, Mikami gets more than she bargained for. As the wicked Nosferatu - a vampire lord able to absorb the very life essence of his victims - begins to turn the city\'s inhabitants into mindless zombies, Mikami\'s team must race against time to save Tokyo from destruction.  Watch The Ultimate Vampire Slayer in this fast, fun and furious supernatural action-adventure!', 'https://image.tmdb.org/t/p/original/ratYneTrbgbtvkPXs3cNp98fChQ.jpg', 6.6, 99.809, 1255896),
(188927, 'Star Trek Beyond', '2016-07-07', 'The USS Enterprise crew explores the furthest reaches of uncharted space, where they encounter a mysterious new enemy who puts them and everything the Federation stands for to the test.', 'https://image.tmdb.org/t/p/original/yOnd3XQIg7JBmu0UuBjZyLdsxQD.jpg', 6.785, 116.253, 58189),
(269149, 'Zootopia', '2016-02-11', 'Determined to prove herself, Officer Judy Hopps, the first bunny on Zootopia\'s police force, jumps at the chance to crack her first case - even if it means partnering with scam-artist fox Nick Wilde to solve the mystery.', 'https://image.tmdb.org/t/p/original/hlK0e0wAQ3VLuJcsfIYPvb4JVud.jpg', 7.748, 108.033, 165787),
(271045, 'Confessions of a Frustrated Housewife', '1976-08-04', 'A wealthy man suffers from impotence whenever he tries to make love to his wife. Since Viagara hadn\'t been invented yet, his swinging liberal doctor instead recommends a strong dose of infidelity. Before long he is rolling in the hay with a young lovely and needless to say his impotence problem is cured (it\'s amazing that he doesn\'t have a heart attack though). His wife is a little bitter, however, and decides to embark on her own affair. And if you\'re wondering with whom, well, just look at the title.', 'https://image.tmdb.org/t/p/original/g7YUdF1Iv0f4ddnfq3Dkqs9woTq.jpg', 6.8, 97.66, 68662),
(284053, 'Thor: Ragnarok', '2017-10-02', 'Thor is imprisoned on the other side of the universe and finds himself in a race against time to get back to Asgard to stop Ragnarok, the destruction of his home-world and the end of Asgardian civilization, at the hands of a powerful new threat, the ruthless Hela.', 'https://image.tmdb.org/t/p/original/rzRwTcFvttcN1ZpX2xv4j3tSdJu.jpg', 7.593, 124.54, 55934),
(293167, 'Kong: Skull Island', '2017-03-08', 'Explore the mysterious and dangerous home of the king of the apes as a team of explorers ventures deep inside the treacherous, primordial island.', 'https://image.tmdb.org/t/p/original/r2517Vz9EhDhj88qwbDVj8DCRZN.jpg', 6.529, 168.876, 236539),
(296096, 'Me Before You', '2016-06-01', 'A small town girl is caught between dead-end jobs. A high-profile, successful man becomes wheelchair bound following an accident. The man decides his life is not worth living until the girl is hired for six months to be his new caretaker. Worlds apart and trapped together by circumstance, the two get off to a rocky start. But the girl becomes determined to prove to the man that life is worth living and as they embark on a series of adventures together, each finds their world changing in ways neither of them could begin to imagine.', 'https://image.tmdb.org/t/p/original/Ia3dzj5LnCj1ZBdlVeJrbKJQxG.jpg', 7.924, 112.816, 1096867),
(298618, 'The Flash', '2023-06-13', 'When his attempt to save his family inadvertently alters the future, Barry Allen becomes trapped in a reality in which General Zod has returned and there are no Super Heroes to turn to. In order to save the world that he is in and return to the future that he knows, Barry\'s only hope is to race for his life. But will making the ultimate sacrifice be enough to reset the universe?', 'https://image.tmdb.org/t/p/original/rktDFPbfHfUbArZ6OOOKsXcv0Bm.jpg', 6.767, 210.29, 1113116),
(299054, 'Expend4bles', '2023-09-15', 'Armed with every weapon they can get their hands on and the skills to use them, The Expendables are the world’s last line of defense and the team that gets called when all other options are off the table. But new team members with new styles and tactics are going to give “new blood” a whole new meaning.', 'https://image.tmdb.org/t/p/original/iwsMu0ehRPbtaSxqiaUDQB9qMWT.jpg', 6.362, 176.936, 293911),
(299534, 'Avengers: Endgame', '2019-04-24', 'After the devastating events of Avengers: Infinity War, the universe is in ruins due to the efforts of the Mad Titan, Thanos. With the help of remaining allies, the Avengers must assemble once more in order to undo Thanos\' actions and restore order to the universe once and for all, no matter what consequences may be in store.', 'https://image.tmdb.org/t/p/original/or06FN3Dka5tukK1e9sl16pB3iy.jpg', 8.256, 147.707, 19272),
(299536, 'Avengers: Infinity War', '2018-04-25', 'As the Avengers and their allies have continued to protect the world from threats too large for any one hero to handle, a new danger has emerged from the cosmic shadows: Thanos. A despot of intergalactic infamy, his goal is to collect all six Infinity Stones, artifacts of unimaginable power, and use them to inflict his twisted will on all of reality. Everything the Avengers have fought for has led up to this moment - the fate of Earth and existence itself has never been more uncertain.', 'https://image.tmdb.org/t/p/original/7WsyChQLEftFiDOVTGkv3hFpyyt.jpg', 8.248, 213.273, 19272),
(301528, 'Toy Story 4', '2019-06-19', 'Woody has always been confident about his place in the world and that his priority is taking care of his kid, whether that\'s Andy or Bonnie. But when Bonnie adds a reluctant new toy called \"Forky\" to her room, a road trip adventure alongside old and new friends will show Woody how big the world can be for a toy.', 'https://image.tmdb.org/t/p/original/w9kR8qbmQ01HwnvK4alvnQ2ca0L.jpg', 7.504, 123.07, 84496),
(303857, 'Dragon Ball Z: Resurrection \'F\'', '2015-04-18', 'One peaceful day on Earth, two remnants of Frieza\'s army named Sorbet and Tagoma arrive searching for the Dragon Balls with the aim of reviving Frieza. They succeed, and Frieza subsequently seeks revenge on the Saiyans.', 'https://image.tmdb.org/t/p/original/soq3AxjALdBfdPAm8H7yuMmNL5Y.jpg', 6.8, 113.332, 1083452),
(313369, 'La La Land', '2016-11-29', 'Mia, an aspiring actress, serves lattes to movie stars in between auditions and Sebastian, a jazz musician, scrapes by playing cocktail party gigs in dingy bars, but as success mounts they are faced with decisions that begin to fray the fragile fabric of their love affair, and the dreams they worked so hard to maintain in each other threaten to rip them apart.', 'https://image.tmdb.org/t/p/original/uDO8zWDhfWwoFdKS4fzkUJt0Rf0.jpg', 7.902, 87.194, 136495),
(315162, 'Puss in Boots: The Last Wish', '2022-12-07', 'Puss in Boots discovers that his passion for adventure has taken its toll: He has burned through eight of his nine lives, leaving him with only one life left. Puss sets out on an epic journey to find the mythical Last Wish and restore his nine lives.', 'https://image.tmdb.org/t/p/original/kuf6dutpsT0vSVehic3EZIqkOBt.jpg', 8.243, 228.511, 1450348),
(315635, 'Spider-Man: Homecoming', '2017-07-05', 'Following the events of Captain America: Civil War, Peter Parker, with the help of his mentor Tony Stark, tries to balance his life as an ordinary high school student in Queens, New York City, with fighting crime as his superhero alter ego Spider-Man as a new threat, the Vulture, emerges.', 'https://image.tmdb.org/t/p/original/c24sv2weTHPsmDa7jEMN0m2P3RT.jpg', 7.338, 132.74, 1293994),
(324552, 'John Wick: Chapter 2', '2017-02-08', 'John Wick is forced out of retirement by a former associate looking to seize control of a shadowy international assassins’ guild. Bound by a blood oath to aid him, Wick travels to Rome and does battle against some of the world’s most dangerous killers.', 'https://image.tmdb.org/t/p/original/hXWBc0ioZP3cN4zCu6SN3YHXZVO.jpg', 7.326, 99.919, 40644),
(324786, 'Hacksaw Ridge', '2016-10-07', 'WWII American Army Medic Desmond T. Doss, who served during the Battle of Okinawa, refuses to kill people and becomes the first Conscientious Objector in American history to receive the Congressional Medal of Honor.', 'https://image.tmdb.org/t/p/original/wuz8TjCIWR2EVVMuEfBnQ1vuGS3.jpg', 8.193, 166.187, 2461),
(324857, 'Spider-Man: Into the Spider-Verse', '2018-12-06', 'Struggling to find his place in the world while juggling school and family, Brooklyn teenager Miles Morales is unexpectedly bitten by a radioactive spider and develops unfathomable powers just like the one and only Spider-Man. While wrestling with the implications of his new abilities, Miles discovers a super collider created by the madman Wilson \"Kingpin\" Fisk, causing others from across the Spider-Verse to be inadvertently transported to his dimension.', 'https://image.tmdb.org/t/p/original/iiZZdoQBEYBv6id8su7ImL0oCbD.jpg', 8.406, 112.883, 936670),
(335787, 'Uncharted', '2022-02-10', 'A young street-smart, Nathan Drake and his wisecracking partner Victor “Sully” Sullivan embark on a dangerous pursuit of “the greatest treasure never found” while also tracking clues that may lead to Nathan’s long-lost brother.', 'https://image.tmdb.org/t/p/original/rJHC1RUORuUhtfNb4Npclx0xnOf.jpg', 6.966, 82.794, 91268),
(335977, 'Indiana Jones and the Dial of Destiny', '2023-06-28', 'Finding himself in a new era, and approaching retirement, Indy wrestles with fitting into a world that seems to have outgrown him. But as the tentacles of an all-too-familiar evil return in the form of an old rival, Indy must don his hat and pick up his whip once more to make sure an ancient and powerful artifact doesn\'t fall into the wrong hands.', 'https://image.tmdb.org/t/p/original/Af4bXE63pVsb2FtbW8uYIyPBadD.jpg', 6.599, 127.318, 366),
