(370464, 'The Masked Saint', '2016-01-08', 'The journey of a professional wrestler who becomes a small town pastor and moonlights as a masked vigilante fighting injustice. While facing crises at home and at the church, the Pastor must evade the police and somehow reconcile his violent secret identity with his calling as a pastor.', 'https://image.tmdb.org/t/p/original/zlT1Tc9hA1Ntye5hr7Gxos9U6U9.jpg', 4.7, 295.107, 63852),
