(437342, 'The First Omen', '2024-04-03', 'When a young American woman is sent to Rome to begin a life of service to the church, she encounters a darkness that causes her to question her own faith and uncovers a terrifying conspiracy that hopes to bring about the birth of evil incarnate.', 'https://image.tmdb.org/t/p/original/hil2ResSCwP95JweZVJsZ5CbZdc.jpg', 0, 128.053, 1706480),
