(453395, 'Doctor Strange in the Multiverse of Madness', '2022-05-04', 'Doctor Strange, with the help of mystical allies both old and new, traverses the mind-bending and dangerous alternate realities of the Multiverse to confront a mysterious new adversary.', 'https://image.tmdb.org/t/p/original/9Gtg2DzBhmYamXBS1hKAhiwbBKS.jpg', 7.316, 111.076, 7623),
(466420, 'Killers of the Flower Moon', '2023-10-18', 'When oil is discovered in 1920s Oklahoma under Osage Nation land, the Osage people are murdered one by one—until the FBI steps in to unravel the mystery.', 'https://image.tmdb.org/t/p/original/dB6Krk806zeqd0YNp2ngQ9zXteH.jpg', 7.498, 196.097, 1032),
(475557, 'Joker', '2019-10-01', 'During the 1980s, a failed stand-up comedian is driven insane and turns to a life of crime and chaos in Gotham City while becoming an infamous psychopathic crime figure.', 'https://image.tmdb.org/t/p/original/udDclJoHjfjb8Ekgsd4FDteOkCU.jpg', 8.163, 167.476, 57130),
(496243, 'Parasite', '2019-05-30', 'All unemployed, Ki-taek\'s family takes peculiar interest in the wealthy and glamorous Parks for their livelihood until they get entangled in an unexpected incident.', 'https://image.tmdb.org/t/p/original/7IiTTgloJzvGI1TAYymCfbfl3vT.jpg', 8.511, 92.418, 21684),
(502356, 'The Super Mario Bros. Movie', '2023-04-05', 'While working underground to fix a water main, Brooklyn plumbers—and brothers—Mario and Luigi are transported down a mysterious pipe and wander into a magical new world. But when the brothers are separated, Mario embarks on an epic quest to find Luigi.', 'https://image.tmdb.org/t/p/original/qNBAXBIQlnOThrVvA6mA2B5ggV6.jpg', 7.683, 296.774, 1719706),
(503417, 'She Came to Me', '2023-10-06', 'Composer Steven Lauddem is plagued by a creative block which leaves him unable to finish the score for his big comeback opera. When his former therapist-turned-wife Patricia suggests he rekindle his creativity by getting lost in the city, Steven sets out in search of inspiration. His epiphany comes after he meets a spirited woman named Katrina and discovers his life has much more potential than he bargained for, or ever could have imagined.', 'https://image.tmdb.org/t/p/original/2lG18RqCK8qTk7R5jA1L7ZRMWXu.jpg', 5.885, 183.833, 41670),
(505642, 'Black Panther: Wakanda Forever', '2022-11-09', 'Queen Ramonda, Shuri, M’Baku, Okoye and the Dora Milaje fight to protect their nation from intervening world powers in the wake of King T’Challa’s death.  As the Wakandans strive to embrace their next chapter, the heroes must band together with the help of War Dog Nakia and Everett Ross and forge a new path for the kingdom of Wakanda.', 'https://image.tmdb.org/t/p/original/sv1xJUazXeYqALzczSZ3O6nkH75.jpg', 7.143, 176.436, 1056121),
(507086, 'Jurassic World Dominion', '2022-06-01', 'Four years after Isla Nublar was destroyed, dinosaurs now live—and hunt—alongside humans all over the world. This fragile balance will reshape the future and determine, once and for all, whether human beings are to remain the apex predators ona planet they now share with history\'s most fearsome creatures.', 'https://image.tmdb.org/t/p/original/kAVRgw7GgK1CfYEJq8ME6EvRIgU.jpg', 6.726, 143.531, 930707),
(507089, 'Five Nights at Freddy\'s', '2023-10-25', 'Recently fired and desperate for work, a troubled young man named Mike agrees to take a position as a night security guard at an abandoned theme restaurant: Freddy Fazbear\'s Pizzeria. But he soon discovers that nothing at Freddy\'s is what it seems.', 'https://image.tmdb.org/t/p/original/A4j8S6moJS2zNtRR8oWF08gRnL5.jpg', 7.656, 198.515, 2103746),
(508883, 'The Boy and the Heron', '2023-07-14', 'While the Second World War rages, the teenage Mahito, haunted by his mother\'s tragic death, is relocated from Tokyo to the serene rural home of his new stepmother Natsuko, a woman who bears a striking resemblance to the boy\'s mother. As he tries to adjust, this strange new world grows even stranger following the appearance of a persistent gray heron, who perplexes and bedevils Mahito, dubbing him the \"long-awaited one.\"', 'https://image.tmdb.org/t/p/original/2M1p3PPwTV0gV2lsR1Rggby8dQw.jpg', 7.4, 286.593, 608),
(508943, 'Luca', '2021-06-17', 'Luca and his best friend Alberto experience an unforgettable summer on the Italian Riviera. But all the fun is threatened by a deeply-held secret: they are sea monsters from another world just below the water’s surface.', 'https://image.tmdb.org/t/p/original/8tABCBpzu3mZbzMB3sRzMEHEvJi.jpg', 7.837, 144.814, 930567),
(508947, 'Turning Red', '2022-03-10', 'Thirteen-year-old Mei is experiencing the awkwardness of being a teenager with a twist – when she gets too excited, she transforms into a giant red panda.', 'https://image.tmdb.org/t/p/original/qsdjk9oAKSQMWs0Vt5Pyfh6O4GZ.jpg', 7.399, 186.206, 2009739),
(517764, 'The Farm', '2019-04-19', 'The young couple Nora (Nora Yessayan) and Alec (Alec Gaylord) are on their way back from a long road trip. In a  desert town they want to take a break, but when they wake up the next morning when they wake up the next morning, they are no longer in the motel they motel where they had actually checked in. Overnight, the by a group of crazed killers wearing animal masks, have been abducted.  What would happen if people were treated like cattle for slaughter? On the farm, this horrific idea comes true. As Nora and Alec soon find out, they are not the only ones locked in cages, fattened and fed cages, fattened up and fed by their torturers, only to be slaughtered, disemboweled and eaten as a delicacy by their torturers. For the young couple begins a fight for bare survival.', 'https://image.tmdb.org/t/p/original/7nPMR3QU5vl7cEmB1LE6O6yliCg.jpg', 5.294, 143.923, 2021527),
(518596, 'Fantastic Return To Oz', '2019-10-24', 'A year to the day after Dorothy and the people of the Emerald City defeated Urfin Jus, the villain is trying to exact his revenge. To command the army of Carraci, however, Urfin needs not only the magic book, but also Dorothy’s silver slippers. The slippers are safely hidden away in Dorothy’s house. Unfortunately, Dorothy’s guest, Tim, is overcome by curiosity and picks up the shoes, accidentally transporting himself, Dorothy and the slippers to the Land of Oz. The Emerald City and its citizens are in danger once again.', 'https://image.tmdb.org/t/p/original/15OvRH9eYDsMtkUvJ6GUUaPX5Zn.jpg', 4.9, 145.443, 1567385),
(519182, 'Despicable Me 4', '2024-07-03', 'Gru and Lucy and their girls — Margo, Edith and Agnes — welcome a new member to the Gru family, Gru Jr., who is intent on tormenting his dad. Gru faces a new nemesis in Maxime Le Mal and his femme fatale girlfriend Valentina, and the family is forced to go on the run.', 'https://image.tmdb.org/t/p/original/aun2IpLDx2E08hYj8xnAEUEFLlo.jpg', 0, 117.22, 124748),
(522627, 'The Gentlemen', '2020-01-01', 'American expat Mickey Pearson has built a highly profitable marijuana empire in London. When word gets out that he’s looking to cash out of the business forever it triggers plots, schemes, bribery and blackmail in an attempt to steal his domain out from under him.', 'https://image.tmdb.org/t/p/original/jtrhTYB7xSrJxR1vusu99nvnZ1g.jpg', 7.679, 90.011, 956),
(528656, 'Genghis Khan', '2018-04-28', 'Temüjin and Börte are childhood lovers who are deeply in love; but news of Temüjin\'s father\'s death swiftly disrupted their relationship. Temüjin heads back to his hometown, but was faced with a sudden attack from his father\'s former comrades, causing his whole tribe to be destroyed.', 'https://image.tmdb.org/t/p/original/FgFoX4wlZUT31ErGGzVnNlh8U3.jpg', 4.7, 194.312, 1374932),
(533535, 'Deadpool & Wolverine', '2024-07-24', 'Third entry in the \"Deadpool\" franchise. Plot TBA.', 'https://image.tmdb.org/t/p/original/uxBHXaoOvAwy4NpPpP7nNx2rXYQ.jpg', 0, 119.002, 17825),
(536115, 'Godzilla: The Planet Eater', '2018-11-09', 'With no means for defeating Godzilla Earth, mankind watches as King Ghidorah, clad in a golden light, descends on the planet. The heavens and earth shake once again as the war moves to a higher dimension.', 'https://image.tmdb.org/t/p/original/fOA44BITFth0u4hMSOUgpK0kM6t.jpg', 6.4, 119.104, 1503508),
(545611, 'Everything Everywhere All at Once', '2022-03-24', 'An aging Chinese immigrant is swept up in an insane adventure, where she alone can save what\'s important to her by connecting with the lives she could have led in other universes.', 'https://image.tmdb.org/t/p/original/w3LxiVYdWWRvEVdn5RYq6jIqkb1.jpg', 7.799, 78.549, 1383612),
(551608, 'Haunting on Fraternity Row', '2018-11-02', 'A fraternity house throws their big \"Winter Luau\" party but when fraternity brothers and coeds begin dying horrible deaths they discover an evil entity has taken over the house.', 'https://image.tmdb.org/t/p/original/7Y9EsHwk61JcXbPjGndZrEwPuog.jpg', 5.632, 127.636, 94354),
(565770, 'Blue Beetle', '2023-08-16', 'Recent college grad Jaime Reyes returns home full of aspirations for his future, only to find that home is not quite as he left it. As he searches to find his purpose in the world, fate intervenes when Jaime unexpectedly finds himself in possession of an ancient relic of alien biotechnology: the Scarab.', 'https://image.tmdb.org/t/p/original/mXLOHHc1Zeuwsl4xYKjKh2280oL.jpg', 6.814, 160.217, 1500758),
(566525, 'Shang-Chi and the Legend of the Ten Rings', '2021-09-01', 'Shang-Chi must confront the past he thought he left behind when he is drawn into the web of the mysterious Ten Rings organization.', 'https://image.tmdb.org/t/p/original/1BIoJGKbXjdFDAqUEiA2VHqkK1Z.jpg', 7.562, 98.475, 1144604),
(566810, 'The Dark Kingdom', '2018-11-26', 'To save their Kingdom from an army of undead, a group of warriors must travel through the forbidden lands fighting the fearsome beasts that call The Dark Kingdom their home.', 'https://image.tmdb.org/t/p/original/4kWGZYrTqBRsPIsnZmV3DzJtTi9.jpg', 5.8, 108.33, 1758713),
(568124, 'Encanto', '2021-10-13', 'The tale of an extraordinary family, the Madrigals, who live hidden in the mountains of Colombia, in a magical house, in a vibrant town, in a wondrous, charmed place called an Encanto. The magic of the Encanto has blessed every child in the family—every child except one, Mirabel. But when she discovers that the magic surrounding the Encanto is in danger, Mirabel decides that she, the only ordinary Madrigal, might just be her exceptional family\'s last hope.', 'https://image.tmdb.org/t/p/original/4j0PNHkMr5ax3IA8tjtxcmPU3QT.jpg', 7.606, 134.796, 1318201),
(569094, 'Spider-Man: Across the Spider-Verse', '2023-05-31', 'After reuniting with Gwen Stacy, Brooklyn’s full-time, friendly neighborhood Spider-Man is catapulted across the Multiverse, where he encounters the Spider Society, a team of Spider-People charged with protecting the Multiverse’s very existence. But when the heroes clash on how to handle a new threat, Miles finds himself pitted against the other Spiders and must set out on his own to save those he loves most.', 'https://image.tmdb.org/t/p/original/8Vt6mWEReuy4Of61Lnj5Xj704m8.jpg', 8.38, 248.62, 2451598),
(572802, 'Aquaman and the Lost Kingdom', '2023-12-20', 'Black Manta seeks revenge on Aquaman for his father\'s death. Wielding the Black Trident\'s power, he becomes a formidable foe. To defend Atlantis, Aquaman forges an alliance with his imprisoned brother. They must protect the kingdom.', 'https://image.tmdb.org/t/p/original/7lTnXOy0iNtBAdRP3TZvaKJ77F6.jpg', 6.819, 360.353, 2127),
(575264, 'Mission: Impossible - Dead Reckoning Part One', '2023-07-08', 'Ethan Hunt and his IMF team embark on their most dangerous mission yet: To track down a terrifying new weapon that threatens all of humanity before it falls into the wrong hands. With control of the future and the world\'s fate at stake and dark forces from Ethan\'s past closing in, a deadly race around the globe begins. Confronted by a mysterious, all-powerful enemy, Ethan must consider that nothing can matter more than his mission—not even the lives of those he cares about most.', 'https://image.tmdb.org/t/p/original/NNxYkU70HPurnNCSiCjYAmacwm.jpg', 7.556, 190.289, 9033),
(580489, 'Venom: Let There Be Carnage', '2021-09-30', 'After finding a host body in investigative reporter Eddie Brock, the alien symbiote must face a new enemy, Carnage, the alter ego of serial killer Cletus Kasady.', 'https://image.tmdb.org/t/p/original/1MJNcPZy46hIy2CmSqOeru0yr5C.jpg', 6.808, 99.833, 1333);
INSERT INTO `Movie` (`movie_id`, `movie_title`, `movie_release`, `movie_overview`, `movie_img_url`, `movie_rating`, `movie_popular`, `director_id`) VALUES
(581528, 'The Gangster, the Cop, the Devil', '2019-05-15', 'After barely surviving a violent attack by an elusive serial killer, crime boss Jang Dong-su finds himself forming an unlikely partnership with local detective Jung Tae-seok to catch the sadistic killer simply known as K.', 'https://image.tmdb.org/t/p/original/oHlM4abRm6BzrRcz9Nup1uidw9H.jpg', 7.798, 90.235, 1910480),
(585083, 'Hotel Transylvania: Transformania', '2022-01-31', 'When Van Helsing\'s mysterious invention, the \"Monsterfication Ray,\" goes haywire, Drac and his monster pals are all transformed into humans, and Johnny becomes a monster. In their new mismatched bodies, Drac and Johnny must team up and race across the globe to find a cure before it\'s too late, and before they drive each other crazy.', 'https://image.tmdb.org/t/p/original/teCy1egGQa0y8ULJvlrDHQKnxBL.jpg', 7.098, 112.647, 2093022),
(588228, 'The Tomorrow War', '2021-09-03', 'The world is stunned when a group of time travelers arrive from the year 2051 to deliver an urgent message: Thirty years in the future, mankind is losing a global war against a deadly alien species. The only hope for survival is for soldiers and civilians from the present to be transported to the future and join the fight. Among those recruited is high school teacher and family man Dan Forester. Determined to save the world for his young daughter, Dan teams up with a brilliant scientist and his estranged father in a desperate quest to rewrite the fate of the planet.', 'https://image.tmdb.org/t/p/original/34nDCQZwaEvsy4CFO5hkGRFDCVU.jpg', 7.6, 89.743, 144816),
(594767, 'Shazam! Fury of the Gods', '2023-03-15', 'Billy Batson and his foster siblings, who transform into superheroes by saying \"Shazam!\", are forced to get back into action and fight the Daughters of Atlas, who they must stop from using a weapon that could destroy the world.', 'https://image.tmdb.org/t/p/original/A3ZbZsmsvNGdprRi2lKgGEeVLEH.jpg', 6.572, 119.954, 1302082),
(598387, 'The Tiger\'s Apprentice', '2024-02-02', 'After the death of his grandmother, Tom Lee discovers he is part of a long lineage of magical protectors known as the Guardians. With guidance from a mythical tiger named Hu and the other Zodiac animal warriors, Tom trains to take on an evil force that threatens humanity.', 'https://image.tmdb.org/t/p/original/iiid1xMhoAcW83VJ9LdAqf4Vtbr.jpg', 7.438, 111.114, 12099),
(601796, 'Alienoid', '2022-07-20', 'In the year 2022, a Robot Guard manages alien prisoners trapped inside human brains. Raising the young girl Ean on Earth, he lives in the guise of a human being. One day, when an alien prisoner escapes, the entire planet is thrown into jeopardy and Guard goes back to the past with Ean to trap the alien there. Meanwhile 630 years earlier during the Goryeo Dynasty, an older Ean is known as \"The Girl Who Shoots Thunder\". While Ean is trying to retrieve the Divine Blade, the key to traveling through time, Muruk, a hapless dosa (Korean tao magician), is aiming to claim the enormous bounty placed on it.', 'https://image.tmdb.org/t/p/original/8QVDXDiOGHRcAD4oM6MXjE0osSj.jpg', 7.2, 1337.19, 119337),
(603692, 'John Wick: Chapter 4', '2023-03-22', 'With the price on his head ever increasing, John Wick uncovers a path to defeating The High Table. But before he can earn his freedom, Wick must face off against a new enemy with powerful alliances across the globe and forces that turn old friends into foes.', 'https://image.tmdb.org/t/p/original/vZloFAK7NmvMGKE7VkF5UHaz0I.jpg', 7.744, 236.138, 40644),
(609681, 'The Marvels', '2023-11-08', 'Carol Danvers, aka Captain Marvel, has reclaimed her identity from the tyrannical Kree and taken revenge on the Supreme Intelligence. But unintended consequences see Carol shouldering the burden of a destabilized universe. When her duties send her to an anomalous wormhole linked to a Kree revolutionary, her powers become entangled with that of Jersey City super-fan Kamala Khan, aka Ms. Marvel, and Carol’s estranged niece, now S.A.B.E.R. astronaut Captain Monica Rambeau. Together, this unlikely trio must team up and learn to work in concert to save the universe.', 'https://image.tmdb.org/t/p/original/9GBhzXMFjgcZ3FdR9w3bUMMTps5.jpg', 6.205, 416.144, 1795072),
(614930, 'Teenage Mutant Ninja Turtles: Mutant Mayhem', '2023-07-31', 'After years of being sheltered from the human world, the Turtle brothers set out to win the hearts of New Yorkers and be accepted as normal teenagers through heroic acts. Their new friend April O\'Neil helps them take on a mysterious crime syndicate, but they soon get in over their heads when an army of mutants is unleashed upon them.', 'https://image.tmdb.org/t/p/original/ueO9MYIOHO7M1PiMUeX74uf8fB9.jpg', 7.277, 110.244, 1578590),
(615656, 'Meg 2: The Trench', '2023-08-02', 'An exploratory dive into the deepest depths of the ocean of a daring research team spirals into chaos when a malevolent mining operation threatens their mission and forces them into a high-stakes battle for survival.', 'https://image.tmdb.org/t/p/original/4m1Au3YkjqsxF8iwQy0fPYSxE0h.jpg', 6.6, 214.102, 137467),
(616037, 'Thor: Love and Thunder', '2022-07-06', 'After his retirement is interrupted by Gorr the God Butcher, a galactic killer who seeks the extinction of the gods, Thor Odinson enlists the help of King Valkyrie, Korg, and ex-girlfriend Jane Foster, who now wields Mjolnir as the Mighty Thor. Together they embark upon a harrowing cosmic adventure to uncover the mystery of the God Butcher’s vengeance and stop him before it’s too late.', 'https://image.tmdb.org/t/p/original/pIkRyD18kl4FhoCNQuWxWu5cBLM.jpg', 6.474, 123.387, 55934),
(634492, 'Madame Web', '2024-02-14', 'Forced to confront revelations about her past, paramedic Cassandra Webb forges a relationship with three young women destined for powerful futures...if they can all survive a deadly present.', 'https://image.tmdb.org/t/p/original/rULWuutDcN5NvtiZi4FRPzRYWSh.jpg', 5.635, 2201.48, 223551),
(634649, 'Spider-Man: No Way Home', '2021-12-15', 'Peter Parker is unmasked and no longer able to separate his normal life from the high-stakes of being a super-hero. When he asks for help from Doctor Strange the stakes become even more dangerous, forcing him to discover what it truly means to be Spider-Man.', 'https://image.tmdb.org/t/p/original/5weKu49pzJCt06OPpjvT80efnQj.jpg', 7.972, 259.829, 1293994),
(637649, 'Wrath of Man', '2021-04-22', 'A cold and mysterious new security guard for a Los Angeles cash truck company surprises his co-workers when he unleashes precision skills during a heist. The crew is left wondering who he is and where he came from. Soon, the marksman\'s ultimate motive becomes clear as he takes dramatic and irrevocable steps to settle a score.', 'https://image.tmdb.org/t/p/original/M7SUK85sKjaStg4TKhlAVyGlz3.jpg', 7.648, 114.033, 956),
(640146, 'Ant-Man and the Wasp: Quantumania', '2023-02-15', 'Super-Hero partners Scott Lang and Hope van Dyne, along with with Hope\'s parents Janet van Dyne and Hank Pym, and Scott\'s daughter Cassie Lang, find themselves exploring the Quantum Realm, interacting with strange new creatures and embarking on an adventure that will push them beyond the limits of what they thought possible.', 'https://image.tmdb.org/t/p/original/qnqGbB22YJ7dSs4o6M7exTpNxPz.jpg', 6.359, 109.022, 59026),
(653346, 'Kingdom of the Planet of the Apes', '2024-05-08', 'Several generations in the future following Caesar\'s reign, apes are now the dominant species and live harmoniously while humans have been reduced to living in the shadows. As a new tyrannical ape leader builds his empire, one young ape undertakes a harrowing journey that will cause him to question all that he has known about the past and to make choices that will define a future for apes and humans alike.', 'https://image.tmdb.org/t/p/original/fAjyUDKABSehK6pHWvh9ket5X3z.jpg', 0, 173.488, 1179066),
(667538, 'Transformers: Rise of the Beasts', '2023-06-06', 'When a new threat capable of destroying the entire planet emerges, Optimus Prime and the Autobots must team up with a powerful faction known as the Maximals. With the fate of humanity hanging in the balance, humans Noah and Elena will do whatever it takes to help the Transformers as they engage in the ultimate battle to save Earth.', 'https://image.tmdb.org/t/p/original/gPbM0MK8CP8A174rmUwGsADNYKD.jpg', 7.3, 248.535, 1551545),
(670292, 'The Creator', '2023-09-27', 'Amid a future war between the human race and the forces of artificial intelligence, a hardened ex-special forces agent grieving the disappearance of his wife, is recruited to hunt down and kill the Creator, the elusive architect of advanced AI who has developed a mysterious weapon with the power to end the war—and mankind itself.', 'https://image.tmdb.org/t/p/original/vBZ0qvaRxqEhZwl6LWmruJqWE8Z.jpg', 7.093, 155.998, 129894),
(673593, 'Mean Girls', '2024-01-10', 'New student Cady Heron is welcomed into the top of the social food chain by the elite group of popular girls called ‘The Plastics,’ ruled by the conniving queen bee Regina George and her minions Gretchen and Karen. However, when Cady makes the major misstep of falling for Regina’s ex-boyfriend Aaron Samuels, she finds herself prey in Regina’s crosshairs. As Cady sets to take down the group’s apex predator with the help of her outcast friends Janis and Damian, she must learn how to stay true to herself while navigating the most cutthroat jungle of all: high school.', 'https://image.tmdb.org/t/p/original/fbbj3viSUDEGT1fFFMNpHP1iUjw.jpg', 6.106, 158.852, 1438991),
(675353, 'Sonic the Hedgehog 2', '2022-03-30', 'After settling in Green Hills, Sonic is eager to prove he has what it takes to be a true hero. His test comes when Dr. Robotnik returns, this time with a new partner, Knuckles, in search for an emerald that has the power to destroy civilizations. Sonic teams up with his own sidekick, Tails, and together they embark on a globe-trotting journey to find the emerald before it falls into the wrong hands.', 'https://image.tmdb.org/t/p/original/6DrHO1jr3qVrViUO6s6kFiAGM7.jpg', 7.524, 129.441, 93364),
(675445, 'PAW Patrol: The Movie', '2021-08-09', 'Ryder and the pups are called to Adventure City to stop Mayor Humdinger from turning the bustling metropolis into a state of chaos.', 'https://image.tmdb.org/t/p/original/ic0intvXZSfBlYPIvWXpU1ivUCO.jpg', 7.4, 81.603, 1098477),
(676727, 'The Inventor', '2023-09-15', 'The insatiably curious and headstrong inventor Leonardo da Vinci leaves Italy to join the French court, where he can experiment freely, inventing flying contraptions, incredible machines, and study the human body. There, joined in his adventure by the audacious princess Marguerite, Leonardo will uncover the answer to the ultimate question – \"What is the meaning of it all?\"', 'https://image.tmdb.org/t/p/original/7Rpo5S3GjORu3yjah0o9eLcllSj.jpg', 6.2, 95.098, 1044850),
(677179, 'Creed III', '2023-03-01', 'After dominating the boxing world, Adonis Creed has thrived in his career and family life. When a childhood friend and former boxing prodigy, Damian Anderson, resurfaces after serving a long sentence in prison, he is eager to prove that he deserves his shot in the ring. The face-off between former friends is more than just a fight. To settle the score, Adonis must put his future on the line to battle Damian — a fighter with nothing to lose.', 'https://image.tmdb.org/t/p/original/cvsXj3I9Q2iyyIo95AecSd1tad7.jpg', 7.125, 148.736, 135651),
(678512, 'Sound of Freedom', '2023-07-03', 'The story of Tim Ballard, a former US government agent, who quits his job in order to devote his life to rescuing children from global sex traffickers.', 'https://image.tmdb.org/t/p/original/qA5kPYZA7FkVvqcEfJRoOy4kpHg.jpg', 8.036, 139.344, 72960),
(682075, 'The Adventure of A.R.I.: My Robot Friend', '2022-01-13', 'A teenager summons the courage to help a friendly robot known as A.R.I. kidnapped by a ruthless lab director working for a powerful corporation seeking to turn him into a dangerous weapon in order to rule the world.', 'https://image.tmdb.org/t/p/original/txcjXiyhBvsSFyZtgCHWW7CyIeN.jpg', 7.1, 340.981, 107794),
(693134, 'Dune: Part Two', '2024-02-27', 'Follow the mythic journey of Paul Atreides as he unites with Chani and the Fremen while on a path of revenge against the conspirators who destroyed his family. Facing a choice between the love of his life and the fate of the known universe, Paul endeavors to prevent a terrible future only he can foresee.', 'https://image.tmdb.org/t/p/original/8b8R8l88Qje9dn9OE8PY05Nxl1X.jpg', 8.4, 778.73, 137427),
(693158, 'Proximity', '2020-05-15', 'A young NASA JPL scientist is abducted by extraterrestrials but when no one believes his story he becomes obsessed with finding proof which leads him on a journey of discovery.', 'https://image.tmdb.org/t/p/original/nto7dx8vmqESDU484huGoSt4o48.jpg', 6.5, 74.716, 1503601),
(713704, 'Evil Dead Rise', '2023-04-12', 'A reunion between two estranged sisters gets cut short by the rise of flesh-possessing demons, thrusting them into a primal battle for survival as they face the most nightmarish version of family imaginable.', 'https://image.tmdb.org/t/p/original/5ik4ATKmNtmJU6AYD0bLm56BCVM.jpg', 7, 107.851, 1398631),
