(951546, 'Reign of Chaos', '2022-04-12', 'When the world is gripped by a plague unleashed by the evil lord Chaos, and humans are turned into rabid creatures, mankind can only be saved by three young women, descendants of a Goddess, with the power to stop Chaos\' evil.', 'https://image.tmdb.org/t/p/original/nTMmpvR9TyV631tpFr4FtYxG0FC.jpg', 5.6, 139.478, 1924465),
(957304, 'Drive-Away Dolls', '2024-02-22', 'Jamie, an uninhibited free spirit bemoaning yet another breakup with a girlfriend, and her demure friend Marian desperately needs to loosen up. In search of a fresh start, the two embark on an impromptu road trip to Tallahassee, but things quickly go awry when they cross paths with a group of inept criminals along the way.', 'https://image.tmdb.org/t/p/original/gavGnAMTXPkpoFgG0stwgIgKb64.jpg', 5.787, 138.886, 1224),
(960481, 'The Warrior Princess', '2021-12-03', 'Princess Khotulun is the daughter of Haidu Khan of the Ugudei dynasty. The film tells the story of Princess Khotulun, the son of Kublai Khan, known in Western and Eastern history as a wrestling princess, and her struggle to reclaim her Golden Sutra.', 'https://image.tmdb.org/t/p/original/gmfPD15AR0FXyNTQE19TbuJNrwu.jpg', 7.2, 94.827, 4041667),
(963591, 'Those Who Call', '2021-12-10', 'When their car breaks down at a small Texan town, two sisters must do everything in their power to survive a sadistic pagan cult.', 'https://image.tmdb.org/t/p/original/kps2mkDFWDnb00BY1kKj0GIjSCP.jpg', 4.333, 218.891, 3509443),
(964592, 'Sleep', '2023-09-06', 'Hyun-su and Soo-jin are newlyweds. Seemingly out of nowhere, he starts talking in his sleep. \"Someone\'s inside.\" From that night on, whenever he falls asleep, he transforms into someone else with no recollection of what happened the night before. Soo-jin is overwhelmed with anxiety that he\'d hurt her family while she sleeps and can barely sleep a wink because of this irrational fear. Despite sleep treatment, Hyun-su\'s sleepwalking only intensifies, and she begins to feel that her unborn child may be in danger.', 'https://image.tmdb.org/t/p/original/b4d90lpmSTLoCP9tkBU7QAQOhh0.jpg', 6.8, 114.392, 2919106),
(965571, 'Patriots Time', '2022-04-28', 'The brothers Sultan and Bekzat Ibrayev are serving faithfully in the Armed Forces of Kazakhstan, and at the same time they are in family disagreement. Sultan is a valiant intelligence officer and Bekzat is a talented fighter pilot. While an international terrorist organization prepares a carefully planned attack on the country\'s strategically important facilities, the brothers have to face not only a mortal threat, but also face a family confrontation related to their dead father. Circumstances force them to unite in order to save human lives, and the brothers eventually understand that their homeland and family are the most valuable thing they have.', 'https://image.tmdb.org/t/p/original/yrafAmPQgr5RWEe67BrbHu7jiB.jpg', 7.8, 174.193, 2147964),
(967847, 'Ghostbusters: Frozen Empire', '2024-03-20', 'The Spengler family returns to where it all started – the iconic New York City firehouse – to team up with the original Ghostbusters, who\'ve developed a top-secret research lab to take busting ghosts to the next level. But when the discovery of an ancient artifact unleashes an evil force, Ghostbusters new and old must join forces to protect their home and save the world from a second Ice Age.', 'https://image.tmdb.org/t/p/original/r65fWcFELCSeyyrkq5wY09EPSGN.jpg', 6.796, 498.697, 57193),
(968051, 'The Nun II', '2023-09-06', 'In 1956 France, a priest is violently murdered, and Sister Irene begins to investigate. She once again comes face-to-face with a powerful evil.', 'https://image.tmdb.org/t/p/original/5gzzkR7y3hnY8AD1wXjCnVlHba5.jpg', 6.8, 138.641, 1607672),
(976573, 'Elemental', '2023-06-14', 'In a city where fire, water, land and air residents live together, a fiery young woman and a go-with-the-flow guy will discover something elemental: how much they have in common.', 'https://image.tmdb.org/t/p/original/4Y1WNkd88JXmGfhtWR7dmDAo1T2.jpg', 7.666, 229.32, 21198),
(977331, 'Cat and Dog', '2024-02-14', 'While about to take off, Monica, the owner of a famous influencer cat named Diva, and Jack, an international thief whose dog Chichi swallowed a stolen ruby, dis- cover that their pets have gotten lost on the tarmac. The owners – and their pets – must team up to find their loved ones. But they don’t know that Brandt, a cop hot on their heels, will do anything to get his hands on the ruby!', 'https://image.tmdb.org/t/p/original/3SYqAvxQIddxY5Bd6sWV9Q9kMTw.jpg', 6.32, 212.571, 583687),
(980137, 'Dad or Mom', '2023-11-30', 'Florencia and Vicente are getting divorced. When both are promoted at their jobs, they will do anything in order to do not keep custody of their children.', 'https://image.tmdb.org/t/p/original/e0ezklncv9ApFVj50FSYJZo08oT.jpg', 7.201, 154.036, 1205254),
(980489, 'Gran Turismo', '2023-08-09', 'The ultimate wish-fulfillment tale of a teenage Gran Turismo player whose gaming skills won him a series of Nissan competitions to become an actual professional racecar driver.', 'https://image.tmdb.org/t/p/original/51tqzRtKMMZEYUpSYkrUE7v9ehm.jpg', 7.866, 142.442, 82194),
(981347, 'The Loch Ness Horror', '2023-11-07', 'A vanished submarine prompts a rescue operation that leads to the Loch Ness monster. Having escaped the Loch, the creature unleashes decades of pent-up aggression on those it encounters.', 'https://image.tmdb.org/t/p/original/fFdG5U2PzhRrHRpbbORQrcAMn8D.jpg', 1.8, 203.717, 2735291),
(985939, 'Fall', '2022-08-11', 'For best friends Becky and Hunter, life is all about conquering fears and pushing limits. But after they climb 2,000 feet to the top of a remote, abandoned radio tower, they find themselves stranded with no way down. Now Becky and Hunter’s expert climbing skills will be put to the ultimate test as they desperately fight to survive the elements, a lack of supplies, and vertigo-inducing heights', 'https://image.tmdb.org/t/p/original/v28T5F1IygM8vXWZIycfNEm3xcL.jpg', 7.205, 98.324, 90812),
(993784, 'Lisa Frankenstein', '2024-02-07', 'In 1989, a misunderstood teenager has a high school crush — who just happens to be a handsome corpse! After a set of playfully horrific circumstances bring him back to life, the two embark on a murderous journey to find love, happiness…and a few missing body parts along the way.', 'https://image.tmdb.org/t/p/original/7Pm0hYthiHVmTO4MCuP4mWfrJIa.jpg', 6.3, 87.115, 84617),
(1006540, 'Bullet Train Down', '2022-08-01', 'On its maiden run, the world\'s fastest bullet train is rigged with a bomb that will explode if it dips below 200 mph.', 'https://image.tmdb.org/t/p/original/5a7cocgyVuFjYV71neDIGVzD6Yq.jpg', 5.024, 941.257, 1604265),
(1008042, 'Talk to Me', '2023-07-26', 'When a group of friends discover how to conjure spirits using an embalmed hand, they become hooked on the new thrill, until one of them goes too far and unleashes terrifying supernatural forces.', 'https://image.tmdb.org/t/p/original/kdPMUMJzyYAc4roD52qavX0nLIC.jpg', 7.194, 141.893, 2070453),
(1011985, 'Kung Fu Panda 4', '2024-03-02', 'Po is gearing up to become the spiritual leader of his Valley of Peace, but also needs someone to take his place as Dragon Warrior. As such, he will train a new kung fu practitioner for the spot and will encounter a villain called the Chameleon who conjures villains from the past.', 'https://image.tmdb.org/t/p/original/kDp1vUBnMpe8ak4rjgl3cLELqjU.jpg', 6.937, 4028.17, 64151),
(1014590, 'Upgraded', '2024-02-07', 'Ana is an ambitious intern dreaming of a career in the art world while trying to impress her demanding boss Claire. When she\'s upgraded to first class on a work trip, she meets handsome Will, who mistakes Ana for her boss– a white lie that sets off a glamorous chain of events, romance and opportunity, until her fib threatens to surface.', 'https://image.tmdb.org/t/p/original/eYsdP5QffklSZMXJMy295xTHKmt.jpg', 7.353, 121.673, 965770),
(1022690, 'Ricky Stanicky', '2024-02-21', 'When three childhood best friends pull a prank gone wrong, they invent the imaginary Ricky Stanicky to get them out of trouble. Twenty years later, the trio still uses the nonexistent Ricky as a handy alibi for their immature behavior. But when their spouses and partners get suspicious and demand to finally meet the fabled Mr. Stanicky, the guilty trio decide to hire a washed-up actor and raunchy celebrity impersonator to bring him to life.', 'https://image.tmdb.org/t/p/original/heSgHkFtzvPdNoWTyJgfre3uljc.jpg', 6.369, 161.294, 7396),
(1022789, 'Inside Out 2', '2024-06-12', 'Teenager Riley\'s mind headquarters is undergoing a sudden demolition to make room for something entirely unexpected: new Emotions! Joy, Sadness, Anger, Fear and Disgust, who’ve long been running a successful operation by all accounts, aren’t sure how to feel when Anxiety shows up. And it looks like she’s not alone.', 'https://image.tmdb.org/t/p/original/xeqXXTE1Cd3qNaAEOT6qbhhCsgJ.jpg', 0, 289.896, 182001),
(1022796, 'Wish', '2023-11-13', 'Asha, a sharp-witted idealist, makes a wish so powerful that it is answered by a cosmic force – a little ball of boundless energy called Star. Together, Asha and Star confront a most formidable foe - the ruler of Rosas, King Magnifico - to save her community and prove that when the will of one courageous human connects with the magic of the stars, wondrous things can happen.', 'https://image.tmdb.org/t/p/original/AcoVfiv1rrWOmAdpnAMnM56ki19.jpg', 6.623, 404.814, 2375591),
(1026436, 'Miller\'s Girl', '2024-01-18', 'A precocious young writer becomes involved with her high school creative writing teacher in a dark coming-of-age drama that examines the blurred lines of emotional connectivity between professor and protégé.', 'https://image.tmdb.org/t/p/original/y9zzaN65LOO56nUGC31x9mWQzoi.jpg', 6.807, 144.873, 1940991),
(1028703, 'The OctoGames', '2022-10-07', 'Eight contestants compete in eight deadly, classic children\'s games. They seek fame beyond their wildest dreams, competing for the chance to take over the YouTube channel of the famous yet elusive masked content creator known only as \"JaxPro\".', 'https://image.tmdb.org/t/p/original/qGz5rffXhegQH5PGUDiObqoOt06.jpg', 5.571, 328.01, 1743833),
(1029575, 'The Family Plan', '2023-12-14', 'Dan Morgan is many things: a devoted husband, a loving father, a celebrated car salesman. He\'s also a former assassin. And when his past catches up to his present, he\'s forced to take his unsuspecting family on a road trip unlike any other.', 'https://image.tmdb.org/t/p/original/jLLtx3nTRSLGPAKl4RoIv1FbEBr.jpg', 7.338, 256.023, 144798),
(1040148, 'Ruby Gillman, Teenage Kraken', '2023-06-28', 'Ruby Gillman, a sweet and awkward high school student, discovers she\'s a direct descendant of the warrior kraken queens. The kraken are sworn to protect the oceans of the world against the vain, power-hungry mermaids. Destined to inherit the throne from her commanding grandmother, Ruby must use her newfound powers to protect those she loves most.', 'https://image.tmdb.org/t/p/original/8ChIb3WzYAcza1vrXR56v510MWk.jpg', 7.301, 105.943, 71267),
(1041613, 'Immaculate', '2024-03-20', 'Cecilia, an American nun of devout faith, embarks on a new journey in a remote convent in the picturesque Italian countryside. Cecilia’s warm welcome quickly devolves into a nightmare as it becomes clear her new home harbors a sinister secret and unspeakable horrors.', 'https://image.tmdb.org/t/p/original/fdZpvODTX5wwkD0ikZNaClE4AoW.jpg', 6.3, 101.153, 856440),
(1046090, 'The Pig, the Snake and the Pigeon', '2023-10-06', 'The arrogant, third most-wanted criminal in Taiwan, decides to get rid of the top two competitors and crowns himself the most-wanted criminal before dying.', 'https://image.tmdb.org/t/p/original/7IJ7F8tX7IAkpUdaGovOBJqORnJ.jpg', 7.518, 728.272, 119410),
(1049948, 'Vikings: Battle of Heirs', '2023-04-28', 'A young Viking must come to terms with the realization that he may be the King\'s son, who was switched at birth, but not before others try to take his rightful place.', 'https://image.tmdb.org/t/p/original/87goLbbqrJqAxqDS5cBsik1zKT.jpg', 6.846, 709.463, 3560889),
(1071215, 'Thanksgiving', '2023-11-16', 'After a Black Friday riot ends in tragedy, a mysterious Thanksgiving-inspired killer terrorizes Plymouth, Massachusetts - the birthplace of the holiday. Picking off residents one by one, what begins as random revenge killings are soon revealed to be part of a larger, sinister holiday plan.', 'https://image.tmdb.org/t/p/original/2zibQOFcUObHssigFjq9xYWekbJ.jpg', 6.586, 125.511, 16847),
(1072790, 'Anyone But You', '2023-12-21', 'After an amazing first date, Bea and Ben’s fiery attraction turns ice cold — until they find themselves unexpectedly reunited at a destination wedding in Australia. So they do what any two mature adults would do: pretend to be a couple.', 'https://image.tmdb.org/t/p/original/5qHoazZiaLe7oFBok7XlUhg96f2.jpg', 7.076, 514.102, 82511),
(1076364, 'Carl\'s Date', '2023-06-15', 'Carl Fredricksen reluctantly agrees to go on a date with a lady friend—but admittedly has no idea how dating works these days. Ever the helpful friend, Dug steps in to calm Carl\'s pre-date jitters and offer some tried-and-true tips for making friends—if you\'re a dog.', 'https://image.tmdb.org/t/p/original/wakoF2UgsEE3fGs5KpuwMWsaNr2.jpg', 7.5, 94.733, 10);
INSERT INTO `Movie` (`movie_id`, `movie_title`, `movie_release`, `movie_overview`, `movie_img_url`, `movie_rating`, `movie_popular`, `director_id`) VALUES
(1078012, 'Boonie Bears: Guardian Code', '2023-01-22', 'Briar and Bramble, who lost their mother Barbara when they were cubs, are thrown into danger when escorting a scientist, which may lead them to a family reunion.', 'https://image.tmdb.org/t/p/original/lIR8h3Os8peWOave8CGE7xsTFoi.jpg', 7.2, 169.5, 3888575),
(1079394, 'The Five', '2023-01-07', 'A scorned woman enlists the help of five strangers to execute a bank robbery. Tensions rise as the men anxiously await her arrival with the money, leaving the crew to wonder if they have been betrayed.', 'https://image.tmdb.org/t/p/original/xckDPGprPVDpuzhSyo9E7SZJ2wa.jpg', 6.379, 258.813, 1298097),
(1079485, 'Winnie-the-Pooh: Blood and Honey 2', '2024-03-26', 'Winnie the Pooh, Piglet, Owl, and Tigger decide to take the fight to the town of Ashdown, home of Christopher Robin, leaving a bloody trail of death and mayhem in their wake.', 'https://image.tmdb.org/t/p/original/2sADrLwMQof6yYmrJRSa04tFZuS.jpg', 7, 216.676, 3122176),
(1094556, 'The Thundermans Return', '2024-03-07', 'Twins Phoebe and Max are enjoying their superhero lifestyle, but when one \'save\' goes awry, the Thundermans are sent back to Hiddenville. While Hank and Barb enjoy their return, and Billy and Nora look forward to a normal high school life, Max and Phoebe are determined to regain their superhero status.', 'https://image.tmdb.org/t/p/original/2J5eeroLDY0d45mVjpuGhcLZs3W.jpg', 7.9, 341.424, 1951095),
(1118033, 'The Seeding', '2024-01-26', 'When a hiker gets lost in the desert, a gang of feral children propelled by haunting legacies traps him in a sadistic battle for survival with a frightening endgame.', 'https://image.tmdb.org/t/p/original/5Tj2YIh8ZbwUonPtXZU1y18cbVY.jpg', 5.1, 84.936, 1599937),
(1124127, 'Air Force One Down', '2024-02-09', 'On her first assignment aboard Air Force One, a rookie Secret Service agent faces the ultimate test when terrorists hijack the plane, intent on derailing a pivotal energy deal. With the President\'s life on the line and a global crisis at stake, her bravery and skills are pushed to the limit in a relentless battle that could change the course of history.', 'https://image.tmdb.org/t/p/original/nKPoSD4pZ3s3CJ9g3cqWRcQ41TC.jpg', 6.3, 763.229, 113194),
(1125311, 'Imaginary', '2024-03-06', 'When Jessica moves back into her childhood home with her family, her youngest stepdaughter Alice develops an eerie attachment to a stuffed bear named Chauncey she finds in the basement. Alice starts playing games with Chauncey that begin playful and become increasingly sinister. As Alice’s behavior becomes more and more concerning, Jessica intervenes only to realize Chauncey is much more than the stuffed toy bear she believed him to be.', 'https://image.tmdb.org/t/p/original/vlRhgfrfBzJKjeGwoUjTvSwk8gi.jpg', 5.952, 334.567, 55075),
(1136512, 'Jonah', '2024-03-12', 'After an alleged alien abduction of Margot\'s son Jonah, Ozzie and Darren, journalists investigating supernatural cases, are determined to expose the truth. During their investigation, Ozzie grapples with his own haunting memories, leading to intense skepticism about Margot\'s story.', 'https://image.tmdb.org/t/p/original/nhaJGTfYNaof7uxSsUEyeH01NKB.jpg', 0, 125.422, 3205442),
(1143183, 'Rewind', '2023-12-25', 'Mary loves John for as long as she can remember. But after years of marriage, John\'s priorities shift, leading to a strained relationship with Mary, which causes a tragic accident that takes away Mary\'s life. Until one day, John gets an extraordinary proposition - to rewind time and save the life of the woman he loves.', 'https://image.tmdb.org/t/p/original/i8UjdAwezeFHHR4opNb3LxDCQWC.jpg', 6.8, 88.963, 238156),
(1146148, 'Sorry, Charlie', '2023-10-06', 'A remote helpline volunteer is targeted by a stranger who lures women from their homes with a recording of a crying baby.', 'https://image.tmdb.org/t/p/original/5FdlhzK976qK6tbmVre5eX1CGAt.jpg', 5.7, 266.151, 1280880),
(1161663, 'Ghost Project', '2023-08-07', 'Three young programmers come across an abandoned technology meant to detect supernatural presence. They reverse engineer the tech and create an app for their phones which allows them to see ghosts, thus endangering their own lives.', 'https://image.tmdb.org/t/p/original/jYBEX4ed6NBeDYbqC5Rd0xVzblO.jpg', 6.3, 238.774, 1717673),
(1170657, 'Barbie and Stacie to the Rescue', '2024-03-03', 'When the Roberts family heads to Wisconsin for a hot air balloon festival, Stacie finds herself caught in between – too young for the adult activities and too old to play with the littles. But when Barbie and Skipper have a mishap, Stacie has the right skills to save the day!', 'https://image.tmdb.org/t/p/original/3ktT0NphGK2uYRkhBLtNssIgOXl.jpg', 7, 199.254, 92125),
(1196646, 'Camp Pleasant Lake', '2024-02-27', 'A couple breathes life into a new camp on an old campsite, connecting them to a chilling past that unravels a 20-year-old mystery involving a missing young girl. As eerie events unfold, they must confront forces tied to a brutal crime.', 'https://image.tmdb.org/t/p/original/vO4ok0SkjbTfLCICxx0uMzOBoEJ.jpg', 5, 125.686, 2921861),
(1205781, 'Dora: Say Hola to Adventure!', '2023-11-10', 'It’s Dora, the world’s most famous exploradora, like you’ve never seen her before! Join her and ALL her friends for BRAND NEW, magical adventures in the rainforest!', 'https://image.tmdb.org/t/p/original/zN3BO43b0JAn1ZCpbwBH6KEP56U.jpg', 6.5, 173.54, 1384126),
(1207413, 'Dark Parasite', '2023-10-25', 'After a Robbery at a jewelry story, a group of robbers takes refuge with a host in a shabby apartment building in the suburbs. But they don\'t know that in the basement hides an obscure alien creature with telepathic powers.', 'https://image.tmdb.org/t/p/original/hmfVO0q2LCsu2sTOe4KjH1aU5tG.jpg', 6.4, 156.462, 556955),
(1211483, 'Skal - Fight for Survival', '2023-11-24', 'My name\'s Arthur, a huge Internet star who\'s just hit 3 million subs. While in the midst of throwing an epic party to celebrate, the universe had the balls to bring on the effing apocalypse and cut my night short. What was supposed to be a perfect hangover, has turned into an epic fight for survival.', 'https://image.tmdb.org/t/p/original/1On8iF3AsFIbpyfZg1xiGWMAFBn.jpg', 5.348, 397.763, 4407265),
(1217409, 'Jaque Mate', '2024-01-25', 'Duque, an international secret agent who retired years ago after a traumatic event, is forced to return to action when a commando operative kidnaps his niece and forces him to steal a precious scientific formula as part of the ransom.', 'https://image.tmdb.org/t/p/original/o960Qx10rRRA4t44DsjeiYB3Dmh.jpg', 4.4, 416.845, 990708),
(1230393, 'Monsters 103 Mercies Dragon Damnation', '2024-01-21', 'A samurai\'s path leads him to a young waitress whose hometown was destroyed by a dragon. He doesn\'t want any trouble — but it finds them anyway.', 'https://image.tmdb.org/t/p/original/yG8QKnaiz7JoIMh3oxdm0JJN6IG.jpg', 6.8, 134.725, 2264366),
(1239251, 'Megamind vs. the Doom Syndicate', '2024-03-29', 'Megamind\'s former villain team, The Doom Syndicate, has returned. Our newly crowned blue hero must now keep up evil appearances until he can assemble his friends (Roxanne, Ol\' Chum and Keiko) to stop his former evil teammates from launching Metro City to the Moon.', 'https://image.tmdb.org/t/p/original/yRZfiG1QpRkBc7fAmxfcR7Md5EC.jpg', 5.636, 729.8, 1229448),
(1240928, 'Stormy', '2024-03-08', 'Delve into the life and times of Stormy Daniels as she shares her story and account of events that have become part of American history.', 'https://image.tmdb.org/t/p/original/7WdElBdccL5RbJOWjUErFolaaqz.jpg', 6.5, 86.619, 126145),
(1241742, 'EKS', '2024-03-01', 'Three compelling stories in one erotic experience. Yen Durano plays three different women in three titillating stories. In a collaboration of three directors: Roman Perez, Jr., Sigrid Polon, and Omar Deroca.', 'https://image.tmdb.org/t/p/original/s6LjBWS4CAHDV2fe5zcDrms1L7q.jpg', 2, 61.154, 3679755),
(1241748, 'Kalikot', '2024-03-12', 'Sal, a hot single professor, moves across an auto service shop and rocks the world of young repairman Arnel. Ever since Sal came over to get her car fixed, Arnel\'s skilled hands have always been busy. But can he still fix the problems that come with it?', 'https://image.tmdb.org/t/p/original/bnOz6hfBTOIDYyrj8P3Pcj4uVzE.jpg', 10, 92.714, 1491269);
